                BeginContext(2205, 4368, true);
                WriteLiteral(@"</p>
                <p class=""podzagolovok1"" style=""text-indent:25px;"">Оценка нематериальных активов, в т.ч. оценка интеллектуальной собственности</p>
                <p class=""abzac"">Необходимость в <strong>оценке нематериальных активов</strong> возникает при внесении такого рода объектов в уставной фонд предприятия, при совершении сделок купли-продажи или при заключении лицензионного соглашения на право использования интеллектуальной собственности, при определении размера компенсации, а также при изменении стоимости основных средств предприятия в бухгалтерском учете.</p>
                <p class=""abzac"">Интеллектуальная собственность обеспечивает будущие выгоды своему владельцу, воплощаясь в товарной продукции. Изменение будущих денежных потоков по величине зависит от следующих факторов:</p>
                <ul>
                    <li>этап жизненного цикла, переживаемый оцениваемым НМА;</li>
                    <li>производственные мощности и финансовые возможности предприятия, использующего данный ");
                WriteLiteral(@"НМА;</li>
                    <li>планы наращивания производства и реализации продукции с участием объекта оценки;</li>
                    <li>возможности рынка по потреблению нарастающих объемов этой продукции.</li>
                </ul>
                <p class=""podzagolovok1"" style=""margin-left:25px;"">Перечень предоставляемых услуг:</p>
                <ul>
                    <li>Оценка товарных знаков</li>
                    <li>Оценка лицензий</li>
                    <li>Оценка патентов</li>
                    <li>Оценка ноу-хау</li>
                    <li>Оценка объектов авторского права</li>
                    <li>Оценка долговых обязательств в т.ч. вексельное право</li>
                    <li>Оценка ущерба, причиненного в результате незаконного использования различных видов интеллектуальной собственности</li>
                </ul>
                <p class=""abzac"">При выполнении оценки Оценщику необходима информация, содержащая сведения о количественных и качественных характеристи");
                WriteLiteral(@"ках объекта оценки и режима его хозяйственного использования.</p>
                <p class=""podzagolovok1"" style=""margin-left:25px;"">Документы, необходимые для оценки нематериальных активов:</p>
                <ol>
                    <li>Документы, подтверждающие действующие на дату оценки права на объект оценки (правоустанавливающие документы: патент на изобретение, промышленный образец, полезную модель или свидетельство на товарный знак, или лицензионный договор и т.п.).</li>
                    <li>Документы, содержащие сведения о наличии обременений, действующих в отношении объекта оценки, включая обременение залогом или долговыми обязательствами, наличием лицензионных соглашений, договоров, контрактов и т.д.</li>
                    <li>Документы, устанавливающие количественные и качественные характеристики объекта оценки и условия его хозяйственного использования.</li>
                </ol>
                <p class=""abzac"">Также Заказчиком должна быть предоставлена следующая информация:</p>
  ");
                WriteLiteral(@"              <ul>
                    <li>История возникновения и принадлежность прав на объект оценки.</li>
                    <li>Территория и сроки действия исключительных прав, вытекающих из охранных документов на объект оценки.</li>
                    <li>Затраты правообладателя, связанные с созданием объекта оценки или появлением прав на объект оценки.</li>
                    <li>Стадия и продолжительность жизненного цикла (коммерциализации) объекта оценки.</li>
                    <li>Объемы и финансовые результаты хозяйственного использования объекта оценки.</li>
                    <li>Направления, по которым образуются денежные потоки, генерируемые объектом оценки в рамках основной (производственной и коммерческой), инвестиционной и финансовой деятельности предприятия, использующего объект оценки.</li>
                </ul>
